import React, { useCallback, useState } from 'react'
import UseCallbackB from '../UseCallbackB'

function UseCallbackA() {
  	const [age,setAge]=useState(21)
	console.log('UseCallbackA.js');

	const changeAge=useCallback(()=>{
		setAge(age+1)
	},[age])

    return (
		<div>
			<UseCallbackB age={age}/>
			<button className='btn btn-primary' onClick={changeAge}>setAge</button>
		</div>
    )
}

export default UseCallbackA
